import React from 'react';
import { NavLink } from 'react-router-dom';
const LogOut = () => {
  return (
    <ul>
      <li>
        <NavLink to="/create">Signup</NavLink>
      </li>
      <li>
        <NavLink to="/">Log in</NavLink>
      </li>
    </ul>
  );
};

export default LogOut;
